const Tabs = ({ content }) => {
  const [selectedTab, setSelectedTab] = useState(0);

  return (
    <div>
      {content.map((item) => (
        <div key={item.label}>
          <p>{item.label}</p>
        </div>
      ))}
    </div>
  );
};

export default Tabs;
